import React from 'react';
import { FaRegTrashAlt } from "react-icons/fa";


const ul = document.createElement('ul');
document.body.appendChild(ul);
const Movie = ({ name, price }) => {

    return (
        <div>
            <h5>{name}</h5>
            <h5>{price}</h5>
            <FaRegTrashAlt/>
                
            
        </div>
    );
}

export default Movie;
